import { Container } from "react-bootstrap";

function Footer() {
  return (
    <>
      <section
        style={{
          bottom: "0",
          width: "100%",
          backgroundColor: "#2C3539",
          color: "#fff",
          textAlign: "center",
          padding: "10px",
        }}
      >
        <Container>
          <p>@ Copyright All Rights Reserved</p>
        </Container>
      </section>
    </>
  );
}
export default Footer;
